import UserService from "../services/userService";

const userService = new UserService();


export const getUser = async (req, res) => {
  try {
    let resp = await userService.getUser();

    return res.status(200).json(resp);
  } catch (err) {
    console.log("Error:", err);
    next(err);
  }
};

